--
-- Table structure for table `documents`
--

DROP TABLE IF EXISTS `documents`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `documents` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `date_document` datetime NOT NULL COMMENT 'Дата документа',
  `num_document` varchar(32) NOT NULL COMMENT 'Номер докмента',
  `document_type_id` int unsigned NOT NULL COMMENT 'Тип документа',
  `counterparty_id` int unsigned DEFAULT NULL COMMENT 'Контрагент',
  `user_id` int unsigned DEFAULT NULL COMMENT 'Менеджер',
  `warehouse_id` int unsigned NOT NULL COMMENT 'Склад',
  `filename` varchar(255) NOT NULL COMMENT 'Путь к файлу',
  `size` int NOT NULL COMMENT 'Размер файла',
  `metadata` json DEFAULT NULL COMMENT 'Метаданные файла',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `documents_document_type_id_fk` (`document_type_id`),
  KEY `documents_counterparty_id_fk` (`counterparty_id`),
  KEY `documents_user_id_fk` (`user_id`),
  KEY `documents_warehouse_id_fk` (`warehouse_id`),
  KEY `documents_num_document_idx` (`num_document`),
  KEY `documents_updated_at_idx` (`updated_at`),
  CONSTRAINT `documents_counterparty_id_fk` FOREIGN KEY (`counterparty_id`) REFERENCES `counterparties` (`id`),
  CONSTRAINT `documents_document_type_id_fk` FOREIGN KEY (`document_type_id`) REFERENCES `document_types` (`id`),
  CONSTRAINT `documents_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`),
  CONSTRAINT `documents_warehouse_id_fk` FOREIGN KEY (`warehouse_id`) REFERENCES `warehouses` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Документы';
/*!40101 SET character_set_client = @saved_cs_client */;

