  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор',
  `name` varchar(100) NOT NULL COMMENT 'Наименование',
  `nomenclature_type_id` int unsigned NOT NULL COMMENT 'Тип номенклатуры',
