  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `nomenclature_nomenclature_type_id_fk` (`nomenclature_type_id`),
  KEY `nomenclature_country_id_fk` (`country_id`),
  KEY `nomenclature_supplier_id_fk` (`supplier_id`),
  KEY `nomenclature_code_idx` (`code`),
  KEY `nomenclature_updated_at_idx` (`updated_at`),
  CONSTRAINT `nomenclature_country_id_fk` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `nomenclature_nomenclature_type_id_fk` FOREIGN KEY (`nomenclature_type_id`) REFERENCES `nomenclature_types` (`id`),
  CONSTRAINT `nomenclature_supplier_id_fk` FOREIGN KEY (`supplier_id`) REFERENCES `counterparties` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Номенклатура';
